import React, { Component } from 'react';
import axios from 'axios'

import './index.scss'
export default class index extends Component {

    componentDidMount() {
        axios.get('http://localhost:3001/api/gethpoiinfo', { params: {
            subType: "preorder"
        } })
        .then(function(response) {
            console.log(response)
        })
        .catch(function(err) {
            console.log(err)
        })
    }

    render() {
        return (
            <div className="complete-container">
                
                <div className="content-item">
                    <div className="left">
                        <span>比例人形</span>
                        <a href="#">
                            <img src="https://r3.hpoi.net.cn/gk/cover/n/2020/12/e8858754f90c408d82aa8724846702e2.jpeg?date=1608171436505" alt="" />
                        </a>
                    </div>
                    <div className="right">
                        <div>
                            <span>出荷时间</span>
                            <span>7分钟前</span>
                        </div>
                        <div>
                            <span>情报</span>
                        </div>
                        <div className="hpoi-hr-small"></div>
                        <div>寿屋 ARTFX J 炎炎消防队 亚瑟·波义耳 13800円+税 2021年7月12日出荷</div>
                        <div>ARTFX J 炎炎消防队 亚瑟·波义耳</div>
                    </div>
                </div>

            </div>
        )
    }
}
